import React from 'react';
import {Segment, Grid} from "semantic-ui-react";

export default class FooterMatchApp extends React.Component {

    render() {
        return (
            <Segment
                className="Footer"
                attached='bottom'>
                <Grid textalign='center'>
                    <Grid.Row centered>

                    </Grid.Row>
                </Grid>
                <h1>MatchApp</h1>
            </Segment>
        )
    }
}
